// src/lib/generateQuotationPDF.js

import jsPDF from "jspdf";
import autoTable from 'jspdf-autotable';

// ✨ PASO 1: PEGA AQUÍ EL TEXTO BASE64 DE TU LOGO ✨
const logoBase64 = "data:image/png;base64,";
const backgroundImageBase64 = "data:image/png;base64,";
const companyDetails = {
  name: "INNOVA HOGAR",
  slogan: "SEGURO, CONFIABLE Y TRANSPARENTE",
};
const themeColor = [0, 51, 102]; // Azul oscuro para la tabla

export const generateQuotationPDF = (quotation) => {
  const doc = new jsPDF('p', 'mm', 'a4');
  const pageHeight = doc.internal.pageSize.height || doc.internal.pageSize.getHeight();
  const pageWidth = doc.internal.pageSize.width || doc.internal.pageSize.getWidth();

  // --- Márgenes de la página para no tocar el marco ---
  const margin = {
    top: 40, // Espacio desde arriba para la cabecera del marco
    bottom: 40, // Espacio desde abajo para el pie del marco
    left: 20,
    right: 20
  };

  // --- Función para añadir el fondo en cada página ---
  const addBackground = () => {
    doc.addImage(backgroundImageBase64, 'PNG', 0, 0, pageWidth, pageHeight);
  };

  addBackground(); // Añadimos el fondo en la primera página

  const formatDate = (dateString) => new Date(dateString).toLocaleDateString('es-GT', { day: '2-digit', month: '2-digit', year: 'numeric' });
  const formatCurrency = (amount) => `Q ${Number(amount || 0).toLocaleString('en-US', { minimumFractionDigits: 2, maximumFractionDigits: 2 })}`;

  // ======================================================
  // 1. CABECERA
  // ======================================================
  doc.addImage(logoBase64, 'PNG', margin.left, 18, 45, 25); 
  doc.setFont("helvetica", "bold");
  doc.setFontSize(22);
  doc.setTextColor(40, 40, 40);
  doc.text("COTIZACIÓN", pageWidth - margin.right, 35, { align: 'right' });

  // ======================================================
  // 2. SECCIÓN DE DATOS
  // ======================================================
  let startY = 60;
  doc.setFont("helvetica", "bold");
  doc.setFontSize(10);
  doc.setTextColor(150);
  doc.text("CLIENTE:", margin.left, startY);
  doc.text("COTIZACIÓN #:", pageWidth / 2 + 15, startY);
  doc.setFont("helvetica", "normal");
  doc.setTextColor(40);
  doc.text(quotation.client?.name || "N/A", margin.left, startY + 5);
  doc.text(String(quotation.id), pageWidth / 2 + 15, startY + 5);
  
  startY += 12;
  doc.setFont("helvetica", "bold");
  doc.setTextColor(150);
  doc.text("PROYECTO:", margin.left, startY);
  doc.text("FECHA:", pageWidth / 2 + 15, startY);
  doc.setFont("helvetica", "normal");
  doc.setTextColor(40);
  doc.text(quotation.project, margin.left, startY + 5);
  doc.text(formatDate(quotation.createdAt), pageWidth / 2 + 15, startY + 5);
  
  startY += 12;
  doc.setFont("helvetica", "bold");
  doc.setTextColor(150);
  doc.text("PRECIO POR M²:", margin.left, startY);
  doc.setFont("helvetica", "normal");
  doc.setTextColor(40);
  doc.text(formatCurrency(quotation.price_per_m2), margin.left, startY + 5);

  // ======================================================
  // 3. TABLA
  // ======================================================
  const tableColumn = ["#", "Tipo de Ventana", "Color PVC", "Color Vidrio", "Dimensiones", "Cant.", "Precio"];
  const tableRows = quotation.quotation_windows.map((win, index) => [
      index + 1,
      win.window_type.name,
      win.pvcColor.name,
      win.glassColor.name,
      `${(win.width_cm / 100).toFixed(2)} x ${(win.height_cm / 100).toFixed(2)}m`,
      "1",
      formatCurrency(win.price),
  ]);

  autoTable(doc, {
      head: [tableColumn],
      body: tableRows,
      startY: startY + 15,
      theme: 'striped',
      margin: { left: margin.left, right: margin.right },
      headStyles: {
          fillColor: themeColor,
          textColor: [255, 255, 255],
          fontStyle: 'bold',
          halign: 'center',
          fontSize: 9,
      },
      styles: {
          fontSize: 8.5,
          cellPadding: 2.5,
          valign: 'middle'
      },
      columnStyles: {
          0: { halign: 'center', cellWidth: 8 },
          1: { cellWidth: 55 },
          4: { halign: 'center' },
          5: { halign: 'center', cellWidth: 10 },
          6: { halign: 'right' }
      },
      // ✨ Lógica para añadir el fondo en cada nueva página
      didDrawPage: () => {
        // No volvemos a dibujar en la primera página, solo en las siguientes
        if (doc.internal.getCurrentPageInfo().pageNumber > 1) {
          addBackground();
        }
      }
  });

  // ======================================================
  // 4. TOTALES Y OBSERVACIONES
  // ======================================================
  let finalY = doc.lastAutoTable.finalY;

  // Lógica de salto de página simplificada
  if (finalY > pageHeight - margin.bottom) {
      doc.addPage();
      addBackground();
      finalY = margin.top; // Empezamos desde el margen superior en la nueva página
  }
  
  const bottomBlockY = finalY + 10;

  // --- Columna Izquierda: Observaciones ---
  doc.setFontSize(7);
  doc.setFont("helvetica", "normal");
  doc.setTextColor(120);
  const notes = [
    "*Precios sujetos a cambios, sin previo aviso. La cotización tiene vigencia de 8 días.",
    "*Entrega e instalación en el precio incluido, en el perímetro de la Capital,",
    "  Carretera a El Salvador y Departamentos aledaños."
  ];
  doc.text(notes, margin.left, bottomBlockY);
  doc.setFont("helvetica", "bold");
  doc.setTextColor(220, 53, 69);
  doc.text("*PRECIO NO INCLUYE IVA", margin.left, bottomBlockY + 12);

  // --- Columna Derecha: Total ---
  const totalBoxWidth = 60;
  const tableEndX = pageWidth - margin.right;
  const totalBoxStartX = tableEndX - totalBoxWidth;
  doc.setFillColor(...themeColor);
  doc.rect(totalBoxStartX, bottomBlockY, totalBoxWidth, 9, 'F');
  doc.setFontSize(9);
  doc.setFont("helvetica", "bold");
  doc.setTextColor(255, 255, 255);
  doc.text("TOTAL:", totalBoxStartX + 5, bottomBlockY + 6);
  doc.setFontSize(12);
  doc.text(formatCurrency(quotation.total_price), tableEndX - 5, bottomBlockY + 6, { align: 'right' });

  // ======================================================
  // 5. GUARDAR EL DOCUMENTO
  // ======================================================
  doc.save(`Cotizacion_${quotation.id}_${quotation.project}.pdf`);
};